import {IoIosRestaurant} from 'react-icons/io';
import {MdFavoriteBorder} from 'react-icons/md';
import {RiPhoneFill} from 'react-icons/ri';
import {IoMail} from 'react-icons/io5';


class LaunchCustomer extends Component {

    constructor(props){
        super(props);

        this.state = {


            show:false,
            message:null,
            sideshow:false,

          }
      }





  handleShow = ()=>{
    this.setState({
      sideshow:true
    });
  }
  handleClose= () => {
    this.setState({
      sideshow:false
    });
 }


